import React from 'react';
import './App.css';
import runClock from './function';


function App() {
  return (
    <>
      <div className="clock">
        <div className="hourHand" id="hourHand"></div>
        <div className="minuteHand" id="minuteHand"></div>
        <div className="secondHand" id="secondHand"></div>
        <div className="center"></div>
        <div className="time"></div>

        <ul>
          <li><span>1</span></li>
          <li><span>2</span></li>
          <li><span>3</span></li>
          <li><span>4</span></li>
          <li><span>5</span></li>
          <li><span>6</span></li>
          <li><span>7</span></li>
          <li><span>8</span></li>
          <li><span>9</span></li>
          <li><span>10</span></li>
          <li><span>11</span></li>
          <li><span>12</span></li>
        </ul>
      </div>
      {}
    </>
  );
}

export default App;
